import React from 'react';
import Javier from './Javier.png';
import GitHub from './Github-Logo.png';
import Twitter from './Twitter-Logo.png';
import LinkedIn from './LinkedIn-Logo.png';
import Mail from './Mail-Icon.png';
import Pattern from './Pattern.jpeg'
import './App.css';

function App() {
  return (
    <div className="App">
      <header style={{
         backgroundImage: `url(${Pattern})`,backgroundRepeat: 'no-repeat',width:'100%',height:'250px',color:'white'
      }}
        className="App-header">
        <div>
        <h1>Javier Nazario Feliciano</h1>
        <img src={Javier} className="App-logo" alt="logo" />
        </div>
        <div>
        <h2>
          Undergraduate Computer Science
        </h2>
        <p>
          Sorry, it's still under construction.
        </p>
        <p>
          I still want to thank you for visiting and looking at my page.
        </p>
        </div>
        <div>
        <a href={"https://github.com/Javier1019"}>
          <img src={GitHub} className="Link-logo" alt="logo" />
        </a>
        <a href={"https://twitter.com/JavierNazario27"}>
          <img src={Twitter} className="Link-logo" alt="logo" />
        </a>
        <a href={"https://www.linkedin.com/in/javier-andr%C3%A9-nazario-feliciano-255655111/"}>
          <img src={LinkedIn} className="Link-logo" alt="logo" />
        </a>
        <a href='mailto: nazario_114260@students.pupr.edu'>
          <img src={Mail} className="Link-logo" alt="logo" />
        </a>
        </div>

      </header>
    </div>
  );
}

export default App;
